import React from "react";
import Layout from "../components/Layout";

function account(props) {
  this.print();
  return (
    <Layout>
      <div>Account</div>
    </Layout>
  );
}
account.prototype.print = () => {};
Object.setPrototypeOf(account.prototype, React.Component.prototype);

export default account;
